Based on the DC comic book character of the same name, Batman stars Adam West as Batman and Burt Ward as Robin Ã¢â‚¬â€ two crime-fighting heroes who defend Gotham City.

Wealthy entrepreneur Bruce Wayne and his ward Dick Grayson lead a double life; they are actually the crime fighting duo Batman and Robin. When crime strikes in Gotham city, Police Commissioner Gordon contacts the dynamic duo to handle those master criminals who are too much for the regular police. A secret Batpole in the Wayne mansion leads to the Batcave, the official base of the super heroes. Aided only by Bruce Waynes most loyal butler Alfred, the two are often left racing to the scene of the crime in the Batmobile to battle a variety of master criminals, including The Riddler, The Joker, Catwoman, and The Penguin. 


